                { "settle", null },
                { "baseId", baseId },
                { "quoteId", quoteId },
                { "settleId", null },
                { "darkpool", darkpool },
                { "altname", getValue(market, "altname") },
                { "type", "spot" },
                { "spot", true },
                { "margin", (isGreaterThan(leverageBuyLength, 0)) },
                { "swap", false },
                { "future", false },
                { "option", false },
                { "active", true },
                { "contract", false },
                { "linear", null },
                { "inverse", null },
                { "taker", taker },
                { "maker", maker },
                { "contractSize", null },
                { "expiry", null },
                { "expiryDatetime", null },
                { "strike", null },
                { "optionType", null },
                { "precision", new Dictionary<string, object>() {
                    { "amount", this.parseNumber(this.parsePrecision(this.safeString(market, "lot_decimals"))) },
                    { "price", precisionPrice },
