        }
        if (isTrue(isEqual(getValue(body, 0), "{")))
        {
            if (isTrue(!((response).GetType() == typeof(string))))
            {
                if (isTrue(((Dictionary<string,object>)response).ContainsKey(toStringOrNull("error"))))
                {
